<template>
	<view class="content">
		<view class="top_bg">
			<view class="top">我的</view>
			<view class="user_info">
				<view class="left">
					<image :src="data.avatar" mode=""></image>
				    <text v-if="name!='' ">{{name}}</text>
					 <text v-else @tap='log'>请登录</text>
				</view>
				<view class="right" @tap='edit'>
					编辑资料
				</view>
			</view>
		</view>
		<!-- 黑色背景 -->
		<view class="bg_black">
			<view class="left">
				<image src="../../static/img/our/jifen.png" mode=""></image>
				<text>我的积分</text>
				<text>{{score}}</text>
			</view>
			<view class="row">
				
			</view>
			<view class="left">
				<image src="../../static/img/our/jifen2.png" mode=""></image>
				<text>我的积分</text>
				<text>{{fronzen_score}}</text>
			</view>
		</view>
		<view class="tab_list">
			<view class="li" v-for="(item,index) in our_list_one" :key='index' @tap='select_url(item)'>
				<view class="left">
					<image :src="item.image" mode=""></image>
				     <text>{{item.title}}</text>
				</view>
				<view class="right">
					<image src="../../static/img/our/jiantou.png" mode=""></image>
				</view>
			</view>
			<view class="li" @tap='select_server'>
				<view class="left">
					<image src="../../static/img/our/kefu.png" mode=""></image>
				     <text>客服中心</text>
				</view>
				<view class="right">
					<image src="../../static/img/our/jiantou.png" mode=""></image>
				</view>
			</view>
			<view class="row">
			</view>
			<view class="li" v-for="(item,index) in our_list_twe" @tap='select_url(item)'>
				<view class="left">
					<image :src="item.image" mode=""></image>
				     <text>{{item.title}}</text>
				</view>
				<view class="right">
					<image src="../../static/img/our/jiantou.png" mode=""></image>
				</view>
			</view>
		</view>
	</view>
</template>

<script>
	import {getinfot} from '../../api/Index/index.js'
	export default {
		data() {
			return {
				name:'',//用户名
				our_list_one:[
					{
						title:'我的二维码',
						image:'../../static/img/our/erweimaw.png',
						url:'My_code/My_code'
					},
					{
						title:'我的店铺',
						image:'../../static/img/our/dianpu1.png',
						url:'My_store/My_store'
					}
				],
				our_list_twe:[
					{
						title:'关于我们',
						image:'../../static/img/our/guanyu.png',
						url:'about/about'
					},
					{
						title:'意见反馈',
						image:'../../static/img/our/yijian.png',
						url:'opinion/opinion'
					}
				],
				data:{},//所以信息
				score:'',//积分
				fronzen_score:'',//冻结积分
			}
		},
		onLoad() {
			this.getdata();
		},
		onShow() {
			this.getdata();
		},
		methods: {
			/* 点击跳转 */
			select_url(item){
				uni.navigateTo({
					url:item.url
				})
			},
			/* 拨打客服电话 */
			select_server(){
				uni.showModal({
				    title: '客服电话',
				    content: '2356-5258-6955',
				    success: function (res) {
				        if (res.confirm) {
				            console.log('用户点击确定');
				        } else if (res.cancel) {
				            console.log('用户点击取消');
				        }
				    }
				});
			},
			/* 编辑个人信息 */
			edit(){
				uni.navigateTo({
					url:'our_info/our_info'
				})
			},
			/* 跳转登录 */
			log(){
				uni.navigateTo({
					url:'logn/logn'
				})
			},
			/* 获取个人信息 */
			getdata(){
				this.score=uni.getStorageSync('userInfo').score;
				this.fronzen_score=uni.getStorageSync('userInfo').fronzen_score;
				console.log(this.fronzen_score);
				getinfot({token:uni.getStorageSync('token')}).then((res)=>{
					if(res.code==1){
						this.data=res.data;
						this.name=res.data.id;
					}else{
						uni.showToast({
							title:res.msg,
							icon:'none'
						})
					}
				})
			}
			
		}
	}
</script>

